import '../App.css';

function Bottom() {
  return (
    <section className="bottom-page">
        <div id="bottom" className="contact">
            <h2>Contact Information</h2>
            <p>Email: nosajn123@gmail.com</p>
            <p>Phone: (206) 591-5047</p>
        </div>
    </section>
  );
}

export default Bottom;
